class Solution {

    /**
     * @param Integer[] $prices
     * @return Integer
     */
    function minimumCoins($prices) {
        $n = count($prices);
        $dp = array_fill(0, $n, PHP_INT_MAX);
        $dp[0] = $prices[0];
        for ($i = 1; $i < $n; $i++) {
            $dp[$i] = min($dp[$i], $prices[$i]);
            for ($j = 1; $i - $j >= 0; $j++) {
                if ($i - $j + $j < $n) {
                    $dp[$i] = min($dp[$i], $dp[$i - $j] + $prices[$i]);
                }
            }
        }
        $minCoins = $dp[0];
        for ($i = 1; $i < $n; $i++) {
            $minCoins = min($minCoins, $dp[$i]);
            for ($j = 1; $i + $j < $n; $j++) {
                $minCoins = min($minCoins, $dp[$i] + $prices[$i + $j]);
            }
        }
        return $minCoins;
    }
}
